package algorithms;

import java.util.Scanner;

public class CodeChef_1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
	
		Scanner sc=new Scanner(System.in);
		while(sc.hasNextLine())
		{
		    int i=sc.nextInt();
		    if(i!=42)
		    {
		    	System.out.println(i);
		    }
		    else
		    {
		    	break;
		    }
		}

	}

}
